<?phpnamespace Nemundo\Bfs\Abstimmung\Content\Stimmbeteiligung;use Nemundo\Bfs\Abstimmung\Parameter\GeoLevelParameter;use Nemundo\Bfs\Abstimmung\Site\AbstimmungSite;use Nemundo\Bfs\Abstimmung\Type\GeoLevel\GemeindeGeoLevel;use Nemundo\Content\Form\ContentForm;use Nemundo\Content\Type\AbstractContentType;class StimmbeteiligungContentType extends AbstractContentType{    protected function loadContentType()    {        $this->typeLabel = 'Stimmbeteiligung';        $this->typeId = 'ae365e26-d10c-4656-b90b-6cad103b2273';        $this->formClassList[] = ContentForm::class;  // StimmbeteiligungContentForm::class;        $this->viewClassList[] = StimmbeteiligungContentView::class;        $this->viewSite = AbstimmungSite::$site;        $this->dataId = 0;    }    public function getViewSite()    {        $site = parent::getViewSite();        $site->addParameter(new GeoLevelParameter((new GemeindeGeoLevel())->id));        return $site;    }    // von bis    // geo level/kanton    public function getSubject()    {        return parent::getSubject(); // TODO: Change the autogenerated stub    }}